@Panic1zg0d for being my first follower.
@Enderpaperdragon for being my second
and on and on and on...

HORDE HUNTER (A GSOL game)
In Horde Hunter, you are trying to defend your village from an evil colony of Numlings. Use your trusty wooden sword to exterminate them and earn higher ranks!

Use the arrow keys to move/jump.
Use SPACE to swing your sword.

(The GSOL is a console I'm working on behind the scenes. I'll notify you all when it's released!)


























































































































































